public class InnerScheduleTargetFactory(Action<Humidifier.Scheduler.ScheduleTypes.Target> factoryAction = null) : SubResourceFactory<Humidifier.Scheduler.ScheduleTypes.Target>
{

    internal InnerScheduleSqsParametersFactory SqsParametersFactory { get; set; }

    internal InnerScheduleDeadLetterConfigFactory DeadLetterConfigFactory { get; set; }

    internal InnerScheduleEcsParametersFactory EcsParametersFactory { get; set; }

    internal InnerScheduleEventBridgeParametersFactory EventBridgeParametersFactory { get; set; }

    internal InnerScheduleKinesisParametersFactory KinesisParametersFactory { get; set; }

    internal InnerScheduleSageMakerPipelineParametersFactory SageMakerPipelineParametersFactory { get; set; }

    internal InnerScheduleRetryPolicyFactory RetryPolicyFactory { get; set; }

    protected override Humidifier.Scheduler.ScheduleTypes.Target Create()
    {
        var targetResult = CreateTarget();
        factoryAction?.Invoke(targetResult);

        return targetResult;
    }

    private Humidifier.Scheduler.ScheduleTypes.Target CreateTarget()
    {
        var targetResult = new Humidifier.Scheduler.ScheduleTypes.Target();

        return targetResult;
    }
    public override void CreateChildren(Humidifier.Scheduler.ScheduleTypes.Target result)
    {
        base.CreateChildren(result);

        result.SqsParameters ??= SqsParametersFactory?.Build();
        result.DeadLetterConfig ??= DeadLetterConfigFactory?.Build();
        result.EcsParameters ??= EcsParametersFactory?.Build();
        result.EventBridgeParameters ??= EventBridgeParametersFactory?.Build();
        result.KinesisParameters ??= KinesisParametersFactory?.Build();
        result.SageMakerPipelineParameters ??= SageMakerPipelineParametersFactory?.Build();
        result.RetryPolicy ??= RetryPolicyFactory?.Build();
    }

} // End Of Class

